/*
 * [Source] https://leetcode.com/problems/merge-intervals/
 * [Difficulty]: Hard
 * [Tag]: Array
 * [Tag]: Sort
 */

#include <iostream>
#include <vector>
#include <algorithm>

using namespace std;

struct Interval {
    int start;
    int end;
    Interval() : start(0), end(0) {}
    Interval(int s, int e) : start(s), end(e) {}
};

class Solution {
public:
    vector<Interval> merge(vector<Interval>& intervals) {
        vector<Point> points;
        for (Interval &interval : intervals) {
            points.push_back( {interval.start, true} );
            points.push_back( {interval.end, false} );
        }
        sort(points.begin(), points.end(), smaller);

        vector<Interval> res;
        int cnt = 0;
        int st = 0;
        for (Point &point : points) {
            if (point.isStart) {
                ++cnt;
            } else {
                --cnt;
            }

            if (cnt == 1 && point.isStart)
                st = point.val;
            else if (cnt == 0 && !point.isStart)
                res.push_back( Interval(st, point.val) );
        }
        return res;
    }

private:
    struct Point {
        int val;
        bool isStart;
    };

    static bool smaller(const Point &p1, const Point &p2) {
        if (p1.val == p2.val)
            return p1.isStart && !p2.isStart; // must make sure compare can be singly identifyed
        return p1.val < p2.val;
    }
};

// [Solution]: sort by start, then check if previous end is larger than next start. If so, overlap.
// [Corner Case]: 0 intervals.
class SolutionInterval {
private:
    bool static intervalCompare(const Interval& smaller, const Interval& larger) {
        return smaller.start < larger.start;
    }

public:
    vector<Interval> merge(vector<Interval>& intervals) {
        vector<Interval> res;
        int len = intervals.size();
        if (len == 0)
            return res;

        sort(intervals.begin(), intervals.end(), intervalCompare);
        int intSt = intervals[0].start, intEd = intervals[0].end;
        for (int i = 1; i < len; ++i) {
            const Interval& cur = intervals[i];
            if (cur.start > intEd) {
                res.push_back(Interval(intSt, intEd));
                intSt = cur.start;
                intEd = cur.end;
            } else {
                intEd = max(intEd, cur.end);
            }
        }
        res.push_back(Interval(intSt, intEd));

        return res;
    }
};

// helper
void printIntervalVec(const vector<Interval>& vec) {
    for (const Interval& interval : vec) {
        cout << "{" << interval.start << "," << interval.end << "} ";
    }
    cout << endl;
}

